import React, { Component } from 'react'

export default class Pomodoro extends Component {
  render() {
    return (
      <div>
        <h1>Pomodoro</h1>
        <span
          style = {{
            fontSize: '1rem',
            textAlign: 'center'
          }}
        >a collaborative effort with<br />Claire Sinozich</span>
      </div>
    )
  }
}
